import React from 'react';
function Card(props){
    //console.log(props);
    return(
        <React.Fragment>
        <div className="cards">
            <div  className="card">
                <img src={props.imgsrc} alt={props.alts} className="card__img" />
                <div className="card__info">
                    <span className="card__categary">{props.title}</span>
                    <h3 className="card__heading">{props.sname}</h3>
                    <a href={props.links}>
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    </React.Fragment>
    );
}
export default Card;
